import React from "react";
import styled from "styled-components";

const StyledCard = styled.div`
  border-radius: 10px;
  box-shadow: 0 2 8px rgba(0, 0, 0, 0.26);
`;

function Card(props) {
  return <StyledCard>{props.children}</StyledCard>;
}

export default Card;
